pragma solidity ^0.5.10;

import "../multisig/OrgMultisig.sol";

import "./Factory.sol";
import "./FactoryWrapper.sol";

/**
* @title OrgFactoryWrapper
* @author Disberse LTD
* @notice A wrapper contract for atomically deploying and intializing delegatecall proxies. Tightly 
* coupled with both `Proxy.sol` and `OrgMultisig.sol`.
*/
contract OrgFactoryWrapper is FactoryWrapper {

    /////
    // Constants:
    /////

    // TODO@nik: check that this generates the right function signature!
    // The function selector for the OrgMultisig `setup` function.
    string internal constant SETUP_FUNCTION_SIGNATURE = "setup(uint256,uint256,address[],address,address,address)";
    bytes4 internal constant SETUP_SELECTOR = bytes4(keccak256(bytes(SETUP_FUNCTION_SIGNATURE)));

    /////
    // Storage:
    /////

    // The registry address for deployed proxies:
    address public defaultRegistry;

    /////
    // Constructor
    /////

    // TODO@nik: do this inherited constructor the right way
    /**
     * @dev Constructor.
     * @param _guard The guard implementation.
     * @param _factory The address of the contract factory to "wrap".
     * @param _defaultTarget The target address to pass to the deployed proxies.
     * @param _defaultGuard The guard address to pass to the deployed proxies.
     * @param _defaultGrave The grave address to pass to the deployed proxies.
     * @param _defaultRegistry The registry address to pass to the deployed proxies.
     */
    constructor(
        address _guard,
        address _factory,
        address _defaultTarget,
        address _defaultGuard,
        address _defaultGrave,
        address _defaultRegistry
    )
        public
        FactoryWrapper(_guard, _factory, _defaultTarget, _defaultGuard, _defaultGrave)
    {
        defaultRegistry = _defaultRegistry;
    }

    /////
    // Public functions:
    /////

    /**
     * @notice Change the default registry address to pass to deployed proxies.
     * @param _defaultRegistry The new default registry address.
    */
    function setDefaultRegistry(address _defaultRegistry) public onlyAuthorized {
        defaultRegistry = _defaultRegistry;
    }

    /////
    // Internal functions:
    /////

    /**
     * @dev Encodes the _forwardData for the Multisig `setup` function for inclusion in the call to the Proxy `setup` 
     * function.
     * @param _threshold The signer threshold for the multisig (proxy).
     * @param _signers The initial signers for the multisig (proxy).
    */
    function _encodeSetupData(uint _threshold, address[] memory _signers)
        internal
        view
        returns (bytes memory)
    {
        // It's not currently possible to retrieve a selector for an overloaded function in 
        // solidity, so we have to do this manually. For further reference, see:
        // https://github.com/ethereum/solidity/issues/3556
        return abi.encodeWithSelector(
            SETUP_SELECTOR,
            _threshold,
            CHAIN_ID,
            _signers,
            defaultGrave,
            defaultGuard,
            defaultRegistry
        );
    }

}

